=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";

// reactstrap components
import { Container } from "reactstrap";

class PageHeader extends React.Component {
  render() {
    return (
      <div className="page-header header-filter">
        <div className="squares square1" />
        <div className="squares square2" />
        <div className="squares square3" />
        <div className="squares square4" />
        <div className="squares square5" />
        <div className="squares square6" />
        <div className="squares square7" />
        <Container>
          <div className="content-center brand">
            <h1 className="h1-seo">Pramod Gobburi</h1>
            <h2>Software Engineer</h2>
            <h5 className="d-none d-sm-block">
              Computer Science graduate from McNeese State University, software developer at Gophr App LLC. I am experienced and knowledgeable in technical problem solving, programming, and am always driven to learn new things.
            </h5>
          </div>
        </Container>
      </div>
    );
  }
}

export default PageHeader;
